import { ThemeProvider } from "styled-components";
import HomeIcon from "./components/HomeIcon";
import Nav from "./components/Nav";
import GlobalStyles from "./components/styles/Global";

const theme = {
  colors: {
    header: "blue",
    body: "red",
    footer: "black",
  },
};

function App() {
  return (
    <ThemeProvider theme={theme}>
      <>
        <GlobalStyles />
        <Nav></Nav>
      </>
    </ThemeProvider>
  );
}

export default App;
